import React, { Component } from 'react'
import axios from 'axios'
import URL from './config'
import './combined-styles.css'; // Corrected the path to the combined CSS file

import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import GridList from '@material-ui/core/GridList';
import GridListTile from '@material-ui/core/GridListTile';
import GridListTileBar from '@material-ui/core/GridListTileBar';
import ListSubheader from '@material-ui/core/ListSubheader';

class News extends Component {
  constructor(props) {
    super(props)
    this.state = {
      articles: [],
      source: props.source
    }
  }

  render() {
    let { articles, source } = this.state
    const { classes } = this.props

    if (source != this.props.source) this.reloadSource()
    return (
      <div className={classes.root}>
        <GridList cellHeight={180} className={classes.gridList} cols={4}>
          <GridListTile key="Subheader" cols={4} style={{ height: 'auto' }}>
            <ListSubheader component="div">Results for: {this.props.source}</ListSubheader>
          </GridListTile>
        </GridList>

        {/* Featured Headline Section */}
        {articles[0] && (
          <section className={classes.section}>
            <h2 className={classes.sectionHeading}>Featured Headline</h2>
            <GridList cellHeight={180} className={classes.gridList} cols={4}>
              <GridListTile key={articles[0].urlToImage} cols={3} rows={2}>
                <img src={articles[0].urlToImage} alt={articles[0].title} />
                <GridListTileBar
                  title={articles[0].title}
                  subtitle={
                    <span>
                      by: {articles[0].source.name}
                      {articles[0].category && (
                        <span style={{ marginLeft: '10px', fontStyle: 'italic' }}>
                          Category: {articles[0].category}
                        </span>
                      )}
                    </span>
                  }
                  actionIcon={
                    <a
                      href={articles[0].url}
                      target="_blank"
                      rel="noopener noreferrer"
                      className="btn"
                      style={{ marginRight: '10px' }}
                    >
                      Read More
                    </a>
                  }
                />
              </GridListTile>
            </GridList>
          </section>
        )}

        {/* Smaller Headlines Section */}
        {articles.length > 1 && (
          <section className={classes.section}>
            <h2 className={classes.sectionHeading}>Other Headlines</h2>
            <GridList cellHeight={180} className={classes.gridList} cols={4}>
              {articles.slice(1).map((article) => (
                <GridListTile key={article.urlToImage} cols={1} rows={1}>
                  <img src={article.urlToImage} alt={article.title} />
                  <GridListTileBar
                    title={article.title}
                    subtitle={
                      <span>
                        by: {article.source.name}
                        {article.category && (
                          <span style={{ marginLeft: '10px', fontStyle: 'italic' }}>
                            Category: {article.category}
                          </span>
                        )}
                      </span>
                    }
                    actionIcon={
                      <a
                        href={article.url}
                        target="_blank"
                        rel="noopener noreferrer"
                        className="btn"
                        style={{ marginRight: '10px' }}
                      >
                        Read More
                      </a>
                    }
                  />
                </GridListTile>
              ))}
            </GridList>
          </section>
        )}
      </div>
    );
  }
  componentDidMount() {
    this.reloadSource()
  }

  reloadSource() {
    axios
      .get(URL.topHeadlinesURL + URL.apiKey + URL.sources + this.props.source)
      .then(response => {
        console.log(response.data)
        let { data } = response
        this.setState({
          articles: data.articles
        })
      })
  }
}
const styles = {
  root: {
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'space-around',
    overflow: 'hidden',
    backgroundColor: '#f5f5f5', // Replace theme.palette.background.paper with a fixed color
  },
  gridList: {
    width: 1300,
    height: 1500,
  },
  icon: {
    color: 'rgba(255, 255, 255, 0.54)',
  },
  section: {
    marginBottom: '32px', // Replace theme.spacing(4) with a fixed value
    width: '100%',
  },
  sectionHeading: {
    margin: '16px 0', // Replace theme.spacing(2, 0) with fixed values
    textAlign: 'center',
    fontWeight: 'bold',
    color: '#333', // Replace theme.palette.text.primary with a fixed color
  },
};

News.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(News);
